import { Grid, Paper } from "@material-ui/core";

const about = ()=>{
    return(<div>

        <Grid container justify='center' className="a1">
        <Grid container item  direction='column' justify='center' xs={12} sm={12} md={12} lg={6}>
          <Grid item>
            <Box></Box>
          </Grid>
        </Grid>
        <Grid  container item  direction='column' justify='center' xs={12} sm={12} md={12} lg={6}>
          <Paper >World</Paper>
        </Grid>
        </Grid>
     <style global jsx>{`
     .a1{
      margin-top: 0;
      margin-left: 0;
      margin-rigth: 0;
     }
     
     `}</style>
    </div>)
}

export default about;
